import style from "./Courses.module.css";

function coursesMenu(props) {
  console.log(props);
  if (props.state.courses.length === 0) {
    return (
      <div className={style.container}>
        <div>Courses page is empty</div>
      </div>
    );
  }

  return (
    <div className={style.container}>
      <div>
        {props.state.courses.map((p) => (
          <div key={p.id}> </div>
        ))}
      </div>
    </div>
  );
}
export default coursesMenu;
